        </div>

        <div class="section">
            <div class="sectionTitle">Company & Culture</div>
            <div class="sectionBody culture">
                Northbridge Solutions is a mid-sized software company based in Austin, TX, specializing in modern B2B platforms that deliver operational and analytical value to clients. With a workforce of approximately 180 employees, the company is entering an exciting period of growth, launching a new greenfield SaaS product in 2025 and expanding its engineering team.
                <br><br>
                The company fosters a collaborative and learning-focused environment, centered around mentorship, technical growth, and knowledge sharing. Regular code reviews, pair programming, and agile practices support junior developers as they grow, while strong teamwork and open communication are core to Northbridges inclusive and supportive culture. Flexibility is given through a hybrid work model, and career development is actively promoted through structured mentorship and professional advancement opportunities.
            </div>
        </div>

        <div class="section">
            <div class="sectionTitle">Benefits</div>
            <div class="sectionBody benefits">
                <ul class="benefitsList">
                    <li>Competitive salary with annual performance-based reviews</li>
                    <li>Hybrid work model with flexible hours</li>
                    <li>Modern downtown Austin office (23 days per week onsite)</li>
                    <li>Structured mentorship and a personalized development plan</li>
                    <li>Professional development budget (courses, certifications, conferences)</li>
                    <li>Comprehensive health, dental, and vision insurance</li>
                    <li>401(k) plan with employer match</li>
                    <li>Generous paid time off (PTO) and company holidays</li>
                    <li>Wellness allowance</li>
                    <li>Remote work flexibility</li>
                    <li>Commuter reimbursement</li>
                    <li>Professional development stipend</li>
                </ul>
            </div>
        </div>

        <div class="section">
            <div class="sectionTitle">Role Overview</div>
            <div class="sectionBody jobInfo">
                <p>The Junior C# Developer will join Northbridge Solutions New Product Development Team to help build a greenfield SaaS product. Reporting to experienced senior engineers and collaborating closely with product management and UX design, youll be instrumental in implementing backend features and delivering robust web APIs as part of a dynamic cross-functional team.</p>
                <p>Key responsibilities include developing new features in C# within a .NET Core environment, writing and optimizing SQL queries and stored procedures, and using ORMs like Entity Framework Core or Dapper for data access. You will contribute to designing and maintaining RESTful APIs, participate actively in code reviews, backlog grooming, and agile ceremonies, and help write basic unit and integration tests. Debugging and troubleshooting will be conducted alongside senior mentors, providing invaluable on-the-job learning and guidance.</p>
                <p>The role expects you to engage in collaborative software engineering practices, work through pair-programming sessions, and continuously grow both technically and professionally. Northbridges team-oriented, agile work environment provides structured mentorship and regular opportunities to expand your skillset. The position is ideal for early-career technologists eager to make a tangible impact on a modern SaaS product while developing under proven mentorship.</p>
                <p>Success will be driven by your problem-solving skills, effective communication, and collaborative attitude. The hybrid work arrangement offers flexibility and regular in-person teamwork at the company''s vibrant downtown Austin office, ensuring you thrive through both autonomy and structured support as you launch your software engineering career.</p>
            </div>
        </div>

