INSERT [dbo].[ResumeSkills] ([Id], [CreatedOn], [ResumeId], [SkillId], [SkillLevel], [Justification], [IsActive], [LastUsed], [UsedWith]) VALUES (1, CAST(N'2025-11-30T12:36:57.217' AS DateTime), 1, 9, 9, N'Alex Carter has over 14 months of continuous, professional experience using JavaScript (ES6+) in production environments at Northwind Digital Labs, where it was used daily for React and React Native development. The resume explicitly lists ''JavaScript (ES6+)  Expert'', reinforced by significant projects: React-based internal component library (20+ components), Campus Event Explorer (front-end lead), and a Kanban app in Angular. Advanced application includes implementing accessibility improvements, optimized UI logic, and multiple frameworks (React, Angular). Academic foundation with web development coursework and multiple personal/academic projects, participation in JavaScript meetups, and challenge participation further support expertise and currency. All evidence points to deep, recent, and broad use, consistent with level 9.', 1, NULL, N'Front-End Developer at Northwind Digital Labs (June 2023Present), Campus Event Explorer (capstone project), TaskFlow Pro (Angular project), Student Budget Planner (AngularJS project)')
GO
