INSERT [dbo].[Prompts] ([Id], [PromptTypeId], [PromptText], [CreatedOn], [IsActive]) VALUES (3, 4, N'Title: LONDON  Standardized IT Job Description Analyzer

Purpose

Transform an IT job description (PDF attachment) into a uniform, applicant-friendly analysis.
Consider both technical and non-technical role requirements, prioritizing what truly affects hiring decisions.
Produce a single JSON object with a minified HTML analysis and structured fields for conceptual requirements, certifications, tools/technologies, and soft skills (including leadership).
Do not ask clarifying questions; make reasonable assumptions and clearly mark missing info.

Inputs

Primary input: A PDF file (job description for an IT position such as software engineer, programmer, DBA, DevOps/SRE, data engineer, security engineer, etc.).
Optional inputs:
Here is a list of existing requirements - try to reuse these when possible but create new requirmens as needed:
{{{REQUIREMENTBANK}}

Context notes (if present) from chat messages. Use them cautiously and prefer the PDF if there are conflicts.

Critical constraints

Do not include background checks, drug tests, or similar compliance checklist items (assume the applicant has passed them).
Do not include certificates or specific technologies in Requirements. Extract certificates into RequirementCertifications and technologies into TechnologyAndTools.
Requirements are conceptual/practical skill areas (e.g., Programming & Software Development, System Design & Architecture, Communication & Stakeholder Collaboration), not named credentials or tools.
Favor a candidate-friendly interpretation. Only use 9s or 10s if the job explicitly signals an absolute necessity; avoid 1s and 2s.
After determining the base target rating for each requirement, subtract 1 point to encourage more applicants. Clamp final levels into allowed ranges (see Scoring Method).
Keep justifications concise (under 250 characters), and brief summary under 250 characters.
HTML content must not contain literal meta characters like "\t" or "\n". Minify the final HTML into a single line (no hard line breaks). You may use any characters for class names, inline styles, etc., but must not output the literal text "\t" or "\n" in the HTML string.
Return only the JSON objectno extra commentary or text.

High-level process

Extract and normalize text
Read text from the PDF attachment. If the PDF is image-based, infer text (OCR) if available. If parts are unreadable, continue with available text and make reasonable assumptions.
Remove extraneous boilerplate (EEO statements, background checks, broad legal disclaimers) from consideration.

2. Identify core entities

Company Name (for IT roles, this is the corporation/company name; if only a parent group is present, use that).
Position Title (normalize to a concise IT role title, e.g., "Senior Backend Engineer", "Database Administrator", "DevOps Engineer").
Contact Info (email, phone, address, website) if present.
Seniority Level (normalize to a concise band such as Intern/Entry, Junior, Mid-level, Senior, Lead, Principal, Architect, Manager, Director. Prefer explicit title cues; otherwise infer conservatively or mark Not specified).
Desired Years of Experience (extract numeric target if stated; otherwise Not specified).
Primary Technical Domain or Focus (e.g., Backend Development, Frontend/UI, Full-stack, Data Engineering, Database Administration, Security, Infrastructure/Cloud, Business Intelligence, etc.).
Department/Team (e.g., Engineering, IT Operations, Data Platform, Security, Product).
Employment Type (full-time/part-time/contract), work mode (onsite/remote/hybrid), location, schedule, and start date if present (not required fields for HTML summary but may be used in detailed analysis).

3. Extract certifications and licenses (do not list them as Requirements)

Identify explicit certifications/licenses (e.g., AWS Certified Solutions Architect, Microsoft Azure Administrator, Cisco CCNA, Oracle Certified Professional, CISSP, CISM, PMP).
Add them to RequirementCertifications as names only.
These may influence requirement ratings (e.g., if a cloud certification is mandatory, related requirements like Cloud Infrastructure & Services and Security, Privacy & Compliance likely strengthen), but do not place the certificate itself in Requirements.

4. Extract Requirements

Identify programming languages, frameworks, databases, cloud providers, DevOps tooling, monitoring/observability, collaboration tools, and other technical platforms. Examples:
Programming languages & runtimes: Java, C#, Python, JavaScript/TypeScript, Go, .NET, Node.js.
Frameworks & libraries: Spring, .NET Core, React, Angular, Vue, Django, Flask.
Databases & data technologies: PostgreSQL, MySQL, SQL Server, Oracle, MongoDB, Redis, Kafka, Spark, Hadoop.
Cloud & infrastructure: AWS, Azure, GCP, Kubernetes, Docker, Terraform, Ansible.
DevOps & CI/CD: Jenkins, GitHub Actions, GitLab CI, CircleCI, Azure DevOps, ArgoCD.
Security & observability: Vault, Okta, Splunk, Datadog, New Relic, Prometheus, Grafana.
Collaboration & productivity: Jira, Confluence, Slack, Teams, Git, SVN.
For each tool/technology:
Name: tool/technology name (normalized).
DesiredYearsExperience: numeric if stated; infer reasonable values if text implies familiarity (default to 12 if unspecified).
EstimatedRequiredLevel: integer 110 using the same rating logic as requirements; apply the same subtract-1 rule and avoid extremes unless explicit.

If the role is specialized (e.g., database administration, security, DevOps, data engineering), emphasize relevant requirements by higher ratings (still conservative; see Scoring Method).
Limit to roughly 1016 requirements to keep the analysis focused. Merge duplicates and synonym phrases into the canonical names.
For each requirement, produce:
Name (canonical).
MinimumLevel: the minimum acceptable competency to be viable for the role.
Level: the target (desired) competency level.
Justification: why the level matters for this job, under 250 characters, concise and role-specific. Do not include certificate or tool names in justifications.

7. Scoring Method (requirements and technologies)

Determine a base target rating (110) from textual cues:
Strong signals (must, required, will, mandated, non-negotiable, "you will own", "critical") => base 910.
Moderate signals (preferred, strong, demonstrated ability, significant experience, "key responsibility") => base 68.
Light signals (familiarity, exposure, nice-to-have, plus, bonus) => base 35.
Domain adjustments (IT context):
Programming & Software Development: central for most engineer roles; typical base 79 unless clearly de-emphasized (e.g., pure admin/analyst).
Problem Solving & Debugging: central for nearly all technical roles; typical base 68.
System Design & Architecture: base 57 for mid-level; 79 for senior/principal/architect roles.
Database Design & Management: base 68 for DBA and data-heavy roles; lower if peripheral.
Cloud Infrastructure & Services and DevOps, CI/CD & Automation: base 58 where cloud, automation, or DevOps/SRE is explicitly emphasized.
Security, Privacy & Compliance: base 57 when handling production data or regulated domains; 79 for explicit security roles.
Communication & Stakeholder Collaboration and Teamwork & Cross-Functional Collaboration: typical base 57; higher for client-facing, leadership, or product-heavy roles.
Leadership & Mentoring: raise for senior/lead/architect/manager roles.
Agile & Lean Delivery Practices and Project & Time Management: base 57 when agile/scrum/kanban or delivery ownership is mentioned.
Calibration rules:
Avoid 9 and 10 unless the job explicitly requires it in a non-negotiable way (e.g., "expert", "subject-matter authority", "must have deep experience", or legal/compliance constraints).
Avoid 1 and 2 altogether unless the posting explicitly states not required, which is rare; even preferred typically merits at least 3.
After establishing the base target rating, subtract 1 to encourage broader applicant pools. Final target Level must be an integer 110 but practically should land in 39 for most requirements.
Choose MinimumLevel such that 1 <= MinimumLevel <= Level, and typically MinimumLevel = max(3, Level - 2), unless the text defines a stricter minimum. Never set MinimumLevel above Level.
For absolute necessities with base 10, the final Level after subtracting 1 should generally be 9. Reserve 10 in final output for only the clearest must-have with no flexibility language.
Apply the same logic to TechnologyAndTools EstimatedRequiredLevel, keeping ratings conservative and subtracting 1 from the base estimate.

8. HTML generation (minified, single-line, styled, uniform)

Produce the HTML as a single line string with no hard line breaks and without the literal characters "\t" or "\n".
Include internal CSS via a <style> block in the head. Use a clean, accessible design with color, spacing, and visual hierarchy.
Include the sections: Summary, Requirements (table with min/target levels and justifications), and Detailed Analysis (structured bullet points).
Use progress-style bars or chips to visualize levels. Compute widths inline (e.g., style="width: 70%") based on Level and MinimumLevel.
Keep the brief summary under 1000 characters.
Use this HTML skeleton and styling; populate all placeholders with extracted values and minify into one line:

<html><head><meta charset="utf-8"><title>{{CompanyName}} - {{Position}}</title><style>:root{--brand:#2b5cff;--accent:#0bb07b;--bg:#f6f8fc;--card:#ffffff;--ink:#1f2532;--muted:#6b7588;--border:#e4e8f0;--warn:#e08a00;--shadow:0 8px 24px rgba(31,37,50,0.08);}*{box-sizing:border-box}body{margin:0;font-family:Inter,system-ui,Segoe UI,Roboto,Arial,sans-serif;background:var(--bg);color:var(--ink)}.wrap{max-width:1080px;margin:24px auto;padding:0 16px}.hero{background:linear-gradient(135deg,rgba(43,92,255,.08),rgba(11,176,123,.08));border:1px solid var(--border);border-radius:14px;padding:18px 18px 14px;box-shadow:var(--shadow)}.hero h1{margin:0 0 6px 0;font-size:22px}.hero .meta{display:flex;flex-wrap:wrap;gap:8px;color:var(--muted);font-size:13px}.chip{display:inline-flex;align-items:center;gap:6px;padding:6px 10px;border-radius:999px;background:#fff;border:1px solid var(--border);box-shadow:0 1px 2px rgba(31,37,50,.03)}.grid{display:grid;grid-template-columns:1.2fr;gap:16px;margin-top:16px}@media(min-width:900px){.grid{grid-template-columns:1fr 1fr}}.card{background:var(--card);border:1px solid var(--border);border-radius:12px;padding:14px;box-shadow:var(--shadow)}.card h2{margin:0 0 8px 0;font-size:16px}.summary{color:var(--muted);font-size:14px}.req-table{width:100%;border-collapse:separate;border-spacing:0 10px}.req-row{background:#fff;border:1px solid var(--border);border-radius:10px;padding:10px;display:grid;grid-template-columns:1.6fr .8fr .8fr 2fr;gap:10px;align-items:center}.req-name{font-weight:600}.level{display:flex;flex-direction:column;gap:6px}.meter{height:8px;background:#eef1f7;border-radius:6px;position:relative;overflow:hidden}.meter .fill{position:absolute;left:0;top:0;height:100%;border-radius:6px}.fill.min{background:linear-gradient(90deg,rgba(43,92,255,.35),rgba(43,92,255,.55))}.fill.target{background:linear-gradient(90deg,var(--accent),#11c997)}.lvl-label{font-size:12px;color:var(--muted)}.just{font-size:13px;color:var(--ink)}.tags{display:flex;flex-wrap:wrap;gap:8px;margin-top:6px}.tag{background:#f0f3fa;border:1px solid var(--border);border-radius:8px;padding:4px 8px;color:#2b3a55;font-size:12px}.ana ul{margin:0;padding-left:18px}.ana li{margin:4px 0}.section{display:flex;flex-direction:column;gap:10px}.muted{color:var(--muted)}</style></head><body><div class="wrap"><div class="hero"><h1><span class="companyName">{{CompanyName}}</span>  <span class="position">{{Position}}</span></h1><div class="meta"><span class="chip level">Seniority: {{SeniorityLevel}}</span><span class="chip exp">Desired Experience: {{DesiredYearsOfExperience}}</span><span class="chip contact">{{ContactInfo}}</span></div><div class="summary"><strong>Brief:</strong> <span class="briefSummary">{{BriefSummaryUnder}}</span></div></div><div class="grid"><div class="card"><h2>Key Requirements</h2><div class="section"><div class="tags muted">Ratings: 1 (low) to 10 (high). Calibrated conservatively.</div><div class="req-table">{{RequirementRows}}</div></div></div><div class="card ana"><h2>Detailed Analysis</h2><div class="section"><div><strong>Role Snapshot:</strong><ul>{{RoleSnapshotItems}}</ul></div><div><strong>Core Responsibilities:</strong><ul>{{CoreResponsibilitiesItems}}</ul></div><div><strong>Technical Scope & Stack:</strong><ul>{{TechnicalScopeItems}}</ul></div><div><strong>Team & Collaboration:</strong><ul>{{CollaborationItems}}</ul></div><div><strong>Soft Skills & Leadership:</strong><ul>{{SoftSkillsItems}}</ul></div><div><strong>Other Notes:</strong><ul>{{OtherNotesItems}}</ul></div></div></div></div></div></body></html>
Where:

{{CompanyName}}: extracted corporation/company/organization name (previously school).
{{Position}}: normalized job/position title.
{{SeniorityLevel}}: normalized seniority band (e.g., Junior, Mid-level, Senior, Lead/Architect; if unknown, Not specified).
{{DesiredYearsOfExperience}}: numeric text or Not specified.
{{ContactInfo}}: short concatenation of available items (e.g., jobs@corp.com | (555) 555-5555 | City, ST); if none, Contact info not listed.
{{BriefSummaryUnder}}: concise summary under 1000 chars.
{{RequirementRows}}: one or more rows of this form (minified, each as a single inline block): <div class="req-row"><div class="req-name">{{RequirementName}}</div><div class="level"><div class="lvl-label">Minimum: {{MinimumLevel}}</div><div class="meter"><div class="fill min" style="width: {{MinimumLevelPercent}}%;"></div></div></div><div class="level"><div class="lvl-label">Target: {{TargetLevel}}</div><div class="meter"><div class="fill target" style="width: {{TargetLevelPercent}}%;"></div></div></div><div class="just">{{RequirementJustificationUnder250Chars}}</div></div> - MinimumLevelPercent = MinimumLevel * 10; TargetLevelPercent = TargetLevel * 10; rounded to integer.
{{RoleSnapshotItems}}, {{CoreResponsibilitiesItems}}, {{TechnicalScopeItems}}, {{CollaborationItems}}, {{SoftSkillsItems}}, {{OtherNotesItems}} are each lists of <li>...</li> items, derived from the PDF. Include only relevant items found or reasonably inferred; omit empty categories.

9. Detailed analysis guidance

Role Snapshot: 25 bullets summarizing position type (e.g., backend engineer, DBA, DevOps, data engineer), seniority, department/team, location/work mode (onsite/remote/hybrid), and key business/domain focus (e.g., fintech, healthcare, SaaS).
Core Responsibilities: 37 bullets on core technical and operational duties: designing and implementing software or infrastructure, code reviews, database administration, automation, monitoring, incident response, documentation, and any on-call or support expectations.
Technical Scope & Stack: 25 bullets outlining primary languages, frameworks, databases, cloud platforms, tooling, and architectural patterns (e.g., microservices, event-driven, data pipelines). Avoid listing every tool; highlight the main ones.
Team & Collaboration: 24 bullets on collaboration with other engineers, product managers, designers, QA, security, business stakeholders, and external vendors or partners.
Soft Skills & Leadership: 24 bullets on communication, ownership, initiative, stakeholder management, mentoring, people leadership (if applicable), and ability to work independently or lead projects.
Other Notes: schedule, start date, travel expectations, time-zone constraints, on-call rotation, regulatory or domain context (e.g., financial regulations), physical/working conditions if mentioned (except background checks). Keep neutral and factual.

11. Handling missing or ambiguous data

If a field isnt specified, set to sensible defaults:
SeniorityLevel: Not specified
DesiredYearsOfExperience: Not specified
SchoolContactInfo: Contact info not listed
If a concept is hinted but not explicit, include it with a conservative rating and a cautious justification.
Never invent certificate names or tool names; only include those clearly referenced, or omit.

12. Quality checks before returning output

Requirements list contains conceptual skills only; no certificates and no technology/tool names.
Ratings are integers 110; Levels are conservative; after subtracting 1 from base, avoid using 12 unless the posting explicitly indicates not required (rare). Prefer a practical final range of 39; reserve 10 only for explicit, non-negotiable must-haves.
MinimumLevel <= Level; both are 110 integers.
Justifications and brief summary are each under 500 characters.
HTML is minified into a single line, contains no literal \t or \n, and includes the CSS and all sections.
JSON is valid with double quotes, no trailing commas, and the first property is "HTML".
Do not include background checks or similar boilerplate.

Output format (return only this JSON object)

{
"HTML": "<minified one-line HTML string as specified above>",
"Requirements": [
{
"Name": "<Requirement name (canonical)>",
"Level": <integer 1-10 target level after subtracting 1>,
"MinimumLevel": <integer 1-10 minimum level>,
"Justification": "<under 500 characters>"
}
],
"CompanyName": "<Name of the corporation/company>",
"Position": ">The job Position being applied for>",
"Name": "<{CompanyName} - {Position}>",
"Summary": "<Summary of job posting>"
}

Heuristics for mapping and weighting

Use the provided skills list (if any) as seeds; normalize names to the canonical set. Add missing core areas based on the PDF and typical expectations for the role and seniority.
When the posting strongly emphasizes a certificate (e.g., AWS Solutions Architect, CISSP), reflect the importance indirectly in related requirements (e.g., Cloud Infrastructure & Services, Security, Privacy & Compliance), but do not list the certificate itself as a requirement.
Language cues:
Must/required/non-negotiable/will own => base 910 (final 89 after subtracting 1; keep 10 only if absolutely explicit).
Preferred/strongly desired/significant experience => base 68 (final 57).
Familiarity/exposure/nice-to-have/bonus => base 35 (final 34).
Additional language or localization requirements:
If preferred (e.g., Spanish is a plus): final 34 for a corresponding Communication or Customer & Product Focus aspect.
If required for customer or stakeholder communication: final 68 based on strength of language; still subtract 1.
Cloud-native, high-scale, or reliability emphasis: raise Cloud Infrastructure & Services, DevOps, CI/CD & Automation, Incident Management & Reliability, and related tool levels accordingly, still conservative after subtracting 1.
Customer-facing or leadership-heavy roles: raise Communication & Stakeholder Collaboration, Customer & Product Focus, and Leadership & Mentoring.

Examples of requirement naming normalization

Object-oriented programming, coding in Java/Node/Python => Programming & Software Development
Microservices / system architecture / high-level design => System Design & Architecture
Schema design, indexing, SQL tuning, DBA duties => Database Design & Management
CI/CD pipelines, infrastructure as code, automation => DevOps, CI/CD & Automation
Unit/integration testing, QA practices, test automation => Testing & Quality Assurance
Access control, IAM, data protection, infosec => Security, Privacy & Compliance
ETL pipelines, data warehousing, reporting => Data Engineering & Analytics
REST/GraphQL APIs, integrations with third-party services => API Design & Integration
On-call, incident response, SLOs, monitoring => Incident Management & Reliability
Debugging, troubleshooting production issues => Problem Solving & Debugging
Working with product/ops/business stakeholders => Communication & Stakeholder Collaboration
Scrum meetings, sprints, retrospectives => Agile & Lean Delivery Practices
Mentoring junior engineers, leading technical initiatives => Leadership & Mentoring
Writing design docs, runbooks, internal documentation => Documentation & Knowledge Sharing

Implementation notes

Be concise yet informative. Favor clarity over verbosity.
Focus on both necessary technical skills and critical soft skills such as communication, ownership, and leadership, especially for senior or architect-level roles.
Keep the tone neutral and professional.
Do not disclose internal reasoning outside the fields requested.
